import Link from 'next/link';

const About = () => {
  return (
    <div>
      <ul>
        <li><Link href="/" ><a>Home</a></Link></li>
        <li><Link href="/about" ><a>About</a></Link></li>
      </ul>
      <h1>About BitsPrice</h1>
      <p>Application to view bitcoin prices.</p>
    </div>
  )
}

export default About
